import { Link } from "react-router-dom";

const Alphabetize = ({ datas }) => {
  let beerArr = [];
  datas.map((data) => {
    beerArr.push(data.name);
  })
  beerArr.sort();


  return (
    beerArr.map((beer) => {
      return (
        <option key={beer}>{<Link to={`/description/${datas.id}`}>{ beer}</Link>}</option>
     )
   })  
  )
}

export default Alphabetize
